import './App.css';
import Features from './components/Features';
import Header from './components/Header';
import Slider from './components/Slider';
import jsonData from ".data/data.json";

function App() {
  return (
    <div className="App">      
        <Header />
        <Slider />
        <Features data={jsonData}/>
    </div>
  );
}

export default App;
